import React, { Component } from 'react'
import * as faker from 'faker'

export class BlogListItem extends Component {



  componentDidMount(){

  }
  render() {
    if(this.props.blog){

        return (
            <div className="item">
                <div className="image">
                    <img  src={this.props.blog.avatar} alt=""/>
                </div>
                <div className="content">
                <a href="" className="header">{this.props.blog.name}</a>

                <div className="meta">
                  <a className="heart"> <i className="fa fa-heart" aria-hidden="true"></i> </a>
                  <span className="price">0</span>
                  Date: {this.props.blog.createAt}
                  <span className="stay"></span>

                </div>

                <div className="description">
                    <p>
                       {this.props.blog.description} 
                    </p>
                </div>
                </div>
            </div>
        )

    }  

  }
}

export default BlogListItem
